Nature Documentary hosted by Nigel Marven, published by Uktv in 2012 - English narration


Information
------------------------------

Wild Colombia with Nigel Marven
Colombia is a naturalist's paradise, with more vertebrate species than any other country on Earth, including over 160 species of hummingbird and more than 800 types of frog, Wild Colombia with Nigel Marven takes viewers on a journey with Nigel from the Andes to the Amazon, and the Pacific to the Caribbean. He travels to Colombia's major habitats to meet rare and unusual creatures, many filmed for the very first time. Over the course of the series, he heads deep into the Andes to see giant creepy-crawlies, thousands of species of frogs and birds that live like bats. He also travels along the mighty Amazon in search of anacondas and meets owl monkeys and enchanting hummingbirds near the coast of the Caribbean Sea.



2)  Lands of the Anaconda 
Anacondas are the biggest snakes in Colombia. Nigel searches for these awe-inspiring serpents in the flooded forests of the mighty Amazon.



